import React from 'react'
import {Navbar, NavItem} from 'react-materialize'

function NavbarMenu(){
  return(
    <Navbar brand={<a />} alignLinks="left">
      <NavItem onClick={onClick}>
        Getting started
      </NavItem>
      <NavItem href="components.html">
        Components
      </NavItem>
    </Navbar>
  )
}


export default NavbarMenu;
